import './App.css';
import React from "react";

class App extends React.Component {
    render() {
        return (

            <div className="App">
                <header className="App-header">
                    <img src={
                        logo
                    }

                         className="App-logo" alt="logo"/>
                    <p>
                        You're the client number {this.props.clientNumber}
                    </p>
                </header>
            </div>
        )
            ;
    }
}

export default App;
